import React from "react";
import Window from "./Window";

import "./ImageSection.css";

const ImageSection = () => {
  return (
    <div className="windows-wrapper">
      <Window image='../../../data/vortex/ground-truth/save-timestep-3-iso--0.100000-theta-45.000000-phi-90.000000.png' />
      <Window />
    </div>
  );
};

export default ImageSection;
